import React from "react";
import "./Template.css";

const Template = ({children, todoLength}) => {
    return (
        <div className="Template">
            <div className="title">
            var now = new Date();
            var month = now.getMonth();
            
                의 할 일 ({todoLength})</div>
            <div>{children}</div>
        </div>
    );
};

export default Template;
